import { StyleSheet, Dimensions } from "react-native";
const width = Dimensions.get('window').width;

const styles = StyleSheet.create({
    container: {
      alignItems: "center",
      alignSelf: 'stretch',
      flexWrap: 'wrap'
    },
    text: {
        color: "grey",
        fontSize: 30,
        fontWeight: "bold"
      }
  });

export default styles
